Game::Game( MainWindow& wnd )
	:
	wnd( wnd ),
	gfx( wnd )
{
}

void Game::Go()
{
	
		gfx.BeginFrame();
		 playing = true;
		if (tip_joc == 1) {
			if (!viata) {
				playing = false;
				Gameover(100, 100);
				Drawnewgame(650, 20);
				Drawwinner(100, 200);
				Drawp2(150, 204);
			}
			else if (!viata2) {
				playing = false;
				Gameover(100, 100);
				Drawnewgame(650, 20);
				Drawwinner(100, 200);
				Drawp1(150, 204);
			}
			else if (!viata && !viata2) {
				playing = false;
				Drawnewgame(650, 20);
				Gameover(100, 100);
			}
		}
		else {
			if (!viata) {
				playing = false;
				Gameover(100, 100);
				Drawnewgame(650, 20);
				Drawwinner(100, 200);
				Drawbots(150, 204);
			}
			else if (!viata3) {
				playing = false;
				Drawnewgame(650, 20);
				Gameover(100, 100);
				Drawwinner(100, 200);
				Drawp1(150, 204);
			}
		}
		unsigned char c = 'R';
		if (wnd.kbd.KeyIsPressed(c)) Initializari();

		if (playing) {
			if (!tip_joc)
				Drawmeniu(250, 250);
			val = 1;
			if (pauza && wnd.kbd.KeyIsPressed(VK_ESCAPE)) {
				pauza = false;
				val = 0;
			}

			if (pauza == true)
				Drawpause(200, 250);
			else {
				if (!tip_joc) {
					unsigned char a = 'A';
					unsigned char b = 'B';
					if (wnd.kbd.KeyIsPressed(a))
						tip_joc = 1;
					else if (wnd.kbd.KeyIsPressed(b))
						tip_joc = 2;

				}
				else {
					Drawnewgame(650, 20);
					if (viata > 0)
						UpdateTank1();
					if (viata2 > 0 && tip_joc == 1)
						UpdateTank2();
					if (viata3 > 0 && tip_joc == 2)
						UpdateBot();
					Border();
					Proiectil();
					ComposeFrame();
					Drawimages();

				}
			}
		}
		gfx.EndFrame();
}

void Game::UpdateTank1()
{
	Realtank(x,y,dir,61,142,25,1);

	unsigned char sus = VK_UP;
	unsigned char jos = VK_DOWN;
	unsigned char stanga = VK_LEFT;
	unsigned char dreapta = VK_RIGHT;

	if (Valid2(x - speed - 5, y - 10 - speed, x - speed + 27, y - speed + 34)&&wnd.kbd.KeyIsPressed(sus) && wnd.kbd.KeyIsPressed(stanga) && Valid(x - speed - 6, y - 10 - speed) && Valid(x - speed + 27, y - speed + 32))
		x -= speed, y -= speed, dir = 0;
	else if (Valid2(x + speed - 5, y - 10 - speed, x + speed + 27, y + 34 - speed)&&wnd.kbd.KeyIsPressed(sus) && wnd.kbd.KeyIsPressed(dreapta) && Valid(x + speed - 6, y - 10 - speed) && Valid(x + speed + 27, y + 32 - speed))
		x += speed, y -= speed, dir = 0;
	else if (Valid2(x - speed - 5, y - 10 + speed, x - speed + 27, y + 34 + speed)&&wnd.kbd.KeyIsPressed(jos) && wnd.kbd.KeyIsPressed(stanga) && Valid(x - speed - 6, y - 10 + speed) && Valid(x - speed + 27, y + 32 + speed))
		x -= speed, y += speed, dir = 1;
	else if (Valid2(x + speed - 5, y - 10 + speed, x + speed + 27, 34 + y + speed) && wnd.kbd.KeyIsPressed(jos) && wnd.kbd.KeyIsPressed(dreapta) && Valid(x + speed - 6, y - 10 + speed) && Valid(x + speed + 27, 32 + y + speed))
		x += speed, y += speed, dir = 1;
	else if (Valid2(x - speed - 5, y - 10, x - speed + 27, y + 34) && wnd.kbd.KeyIsPressed(stanga) && Valid(x - speed - 6, y - 10) && Valid(x - speed + 27, y + 32))
		x -= speed, dir = 3;
	else if (Valid2(x + speed - 5, y - 10, x + 27 + speed, 34 + y)&&wnd.kbd.KeyIsPressed(dreapta) && Valid(x + speed - 6, y - 10) && Valid(x + 27 + speed, 32 + y))
		x += speed, dir = 2;

	else if (Valid2(x - 5, y - speed - 10, x + 27, y - speed + 34) && wnd.kbd.KeyIsPressed(sus) && Valid(x - 6, y - speed - 10) && Valid(x + 27, y - speed + 32))
		y -= speed, dir = 0;
	else if (Valid2(x - 5, y + speed - 10, x + 27, 34 + y + speed) && wnd.kbd.KeyIsPressed(jos) && Valid(x - 6, y + speed - 10) && Valid(x + 27, 32 + y + speed))
		y += speed, dir = 1;
	
}

void Game::UpdateTank2()
{
		Realtank(x2, y2, dir2,255,255,0,2);
	
	unsigned char sus = 'W';
	unsigned char jos = 'S';
	unsigned char stanga = 'A';
	unsigned char dreapta = 'D';
	
	if (wnd.kbd.KeyIsPressed(sus) && wnd.kbd.KeyIsPressed(stanga) && Valid(x2 - speed2-6, y2-10 - speed2)&& Valid(x2 - speed2+27 , y2 - speed2+32))
		x2 -= speed2, y2 -= speed2, dir2 = 0;
	else if (wnd.kbd.KeyIsPressed(sus) && wnd.kbd.KeyIsPressed(dreapta) && Valid(x2 + speed2-6, y2-10 - speed2) && Valid(x2 + speed2+27, y2+32 - speed2))
		x2 += speed2, y2 -= speed2, dir2 = 0;
	else if (wnd.kbd.KeyIsPressed(jos) && wnd.kbd.KeyIsPressed(stanga) && Valid(x2 - speed2-6, y2 -10+ speed2) && Valid(x2 - speed2+27, y2 +32+ speed2))
		x2 -= speed2, y2 += speed2, dir2 = 1;
	else if (wnd.kbd.KeyIsPressed(jos) && wnd.kbd.KeyIsPressed(dreapta) && Valid(x2 + speed2-6, y2-10 + speed2) && Valid(x2 + speed2+27, 32+y2 + speed2))
		x2 += speed2, y2 += speed2, dir2 = 1;
	else if (wnd.kbd.KeyIsPressed(stanga) && Valid(x2 - speed2-6, y-10) && Valid(x2 - speed2+27, y2+32))
		x2 -= speed2, dir2 = 3;
	else if (wnd.kbd.KeyIsPressed(dreapta) && Valid(x2 + speed2-6, y-10) && Valid(x2+27 + speed2,32+ y2))
		x2 += speed2, dir2 = 2;

	else if (wnd.kbd.KeyIsPressed(sus) && Valid(x2-6, y2 - speed2-10) && Valid(x2+27, y2 - speed2+32))
		y2 -= speed2, dir2 = 0;
	else if (wnd.kbd.KeyIsPressed(jos) && Valid(x2-6, y2 + speed2-10) && Valid(x2+27, 32+y2 + speed2))
		y2 += speed2, dir2 = 1;
	
}

