void Game::Realtank(int l,int h,int dir,int x,int y,int z,int owner)
{
	int i, j;

	for (i = l - 5; i <= l; i++)
		for (j = h - 4; j <= h+34; j++)
			gfx.PutPixel(i, j, 64, 25, 135);
	for (i = l + 22; i <= l + 27; i++)
		for (j = h - 4; j <= h + 34; j++)
			gfx.PutPixel(i, j, 64, 25, 135);
	for (i = l; i <= l + 22; i++)
		for (j = h; j <= h + 30; j++) {
			Runa_viata(i, j, owner);
			gfx.PutPixel(i, j, x, y, z);
		}
	for (i = l + 5; i <= l + 17; i++)
		for (j = h + 5; j <= h + 17; j++)
			gfx.PutPixel(i, j, 88, 94, 133);
	if(!dir)
		for (i = l + 10; i <= l + 12; i++)
			for (j = h - 10; j <= h + 11; j++)
				gfx.PutPixel(i, j, 78, 80, 96);
	else if(dir == 1)
		for (i = l + 10; i <= l + 12; i++)
			for (j = h+11; j <= h + 32; j++)
				gfx.PutPixel(i, j, 78, 80, 96);
	else if(dir == 3)
		for (i = l+10; i >=l-11; i--)
			for (j = h+11; j <= h + 13; j++)
				gfx.PutPixel(i, j, 78, 80, 96);
	else
		for (i = l + 10; i <= l + 31; i++)
			for (j = h + 11; j <= h + 13; j++)
				gfx.PutPixel(i, j, 78, 80, 96);

}

