bool Game::Valid(int x, int y)
{
	if(x < 5 || x > lins || y < 5 || y > cols) return false;
	return true;
}

void Game::Proiectil()
{
	int dx,dy,directie,owner;
	bool gata;
	for (int i = 1; i <= nr_proiectile; ++i) {
		directie = proiectil[i][2];
		owner = proiectil[i][3];
		
		if (!directie)proiectil[i][1]-=3;
		else if (directie == 1)proiectil[i][1]+=3;
		else if (directie == 2)proiectil[i][0]+=3;
		else proiectil[i][0]-=3;
		gata = true;
		if ((owner == 1 && viata<=0)||(owner==2&&viata2<=0)) {
			proiectil[i][0] = proiectil[nr_proiectile][0];
			proiectil[i][1] = proiectil[nr_proiectile][1];
			proiectil[i][2] = proiectil[nr_proiectile][2];
			proiectil[i][3] = proiectil[nr_proiectile][3];
			--nr_proiectile;
			--i;
		}
		
		if (!Valid(proiectil[i][0], proiectil[i][1]) || !Valid(proiectil[i][0]+19,proiectil[i][1]+19))
		{
			proiectil[i][0] = proiectil[nr_proiectile][0];
			proiectil[i][1] = proiectil[nr_proiectile][1];
			proiectil[i][2] = proiectil[nr_proiectile][2];
			proiectil[i][3] = proiectil[nr_proiectile][3];
			--nr_proiectile;
			--i;
			if (owner == 1)--n1;
			else if(owner == 2)--n2;
			else --n3;
			gata = false;
		}
		else {
			dx = proiectil[i][0];
			dy = proiectil[i][1];

			if (owner == 1 && dx >= x2-11 && dx <= x2 + 27 && dy >= y2-10 && dy <= y2 + 34) {
				proiectil[i][0] = proiectil[nr_proiectile][0];
				proiectil[i][1] = proiectil[nr_proiectile][1];
				proiectil[i][2] = proiectil[nr_proiectile][2];
				proiectil[i][3] = proiectil[nr_proiectile][3];
				--nr_proiectile;
				--i;
				--n1;
				--viata2;
				gata = false;
			}
			else if (owner == 2 && dx >= x-11 && dx <= x + 27 && dy >= y-10 && dy <= y + 34) {
				proiectil[i][0] = proiectil[nr_proiectile][0];
				proiectil[i][1] = proiectil[nr_proiectile][1];
				proiectil[i][2] = proiectil[nr_proiectile][2];
				proiectil[i][3] = proiectil[nr_proiectile][3];
				--nr_proiectile;
				--i;
				--n2;
				--viata;
				gata = false;
			}
			else if (owner == 3 && dx >= x-11 && dx <= x + 27 && dy >= y-10 && dy <= y + 34) {
				proiectil[i][0] = proiectil[nr_proiectile][0];
				proiectil[i][1] = proiectil[nr_proiectile][1];
				proiectil[i][2] = proiectil[nr_proiectile][2];
				proiectil[i][3] = proiectil[nr_proiectile][3];
				--nr_proiectile;
				--i;
				--n3;
				--viata;
				gata = false;
			}
			else if (owner == 1 && dx >= x3-5 && dx <= x3 + 27 && dy >= y3-10 && dy <= y3 + 34) {
				proiectil[i][0] = proiectil[nr_proiectile][0];
				proiectil[i][1] = proiectil[nr_proiectile][1];
				proiectil[i][2] = proiectil[nr_proiectile][2];
				proiectil[i][3] = proiectil[nr_proiectile][3];
				--nr_proiectile;
				--i;
				--n1;
				--viata3;
				gata = false;
			}
		}
		if(gata){
			int xx = proiectil[i][0];
			int yy = proiectil[i][1];
			if (owner == 1)
				Drawproiectil(xx, yy, 24, 182, 96);
			else
				Drawproiectil(xx, yy, 112, 112, 112);
		}
	}
}
