void Game::DrawMesajviata(int x, int y)
{
	int i, j,ii,jj;
	for (i = x,j = y;j <= y + 13; ++j, ++i)
		gfx.PutPixel(i, j, 193, 27, 23);

	for (ii = i+1,jj = j-1; jj >= y; --jj, ++ii)
		gfx.PutPixel(ii, jj, 193, 27, 23);
}

